import './App.css';
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Feed from "./Feed.js";
import MainMenu from "./MainMenu.js";

function App() {
  return (
    <div className="App">

      <header className="App-header">
        <h1>Header</h1>
      </header>
      <div className="App-body">
        <BrowserRouter>
            <Switch>
                <Route path="/feed">
                    <Feed />
                </Route>
                <Route>
                    <MainMenu />
                </Route>
            </Switch>
        </BrowserRouter>      
      </div>
    </div>
  );
}

export default App;
